// Challeng: given an array containing 0s, 1s, 2s only, return the array sorted in O(n)!

const sort012 = (arr) => {
    let left = 0; // indicates the position for next 0
    let right = arr.length - 1; // indicates the position for next 2;

    // set the right to the first NOT 0 from the beginning
    while(arr[left] === 0) {
        left ++;
    }

    // set the left to the first NOT 2 from the end;
    while(arr[right] === 2) {
        right --;
    }

    let i = left;

    while( i <= right ) {

        // swapping all 0s to the front;
        if(arr[i] === 0) {
            [ arr[i], arr[left] ] = [ arr[left], arr[i] ];
            while(arr[left] === 0) {
                left ++; // increasing right to the next place other than zero.
            }
        }
        
        // swapping all 2s two the end;
        if(arr[i] === 2) {
            // if swap-partner is a 1, only one swap is necessary;
            if(arr[right] === 1) {
                [ arr[i], arr[right] ] = [ arr[right], arr[i] ];
                
                while(arr[right] === 2) {
                    right --; // reducing left to the next place other than two.
                }
            
            } else if(arr[right] === 0) {
                // if swap-partner is a 0, two swaps are necessary;
                [ arr[i], arr[right] ] = [ arr[right], arr[i] ];
                [ arr[i], arr[left] ] = [ arr[left], arr[i] ];                
                
                while(arr[right] === 2) {
                    right --; // reducing left to the next place other than two.
                }
                while(arr[left] === 0) {
                    left ++; // increasing right to the next place other than zero.
                }
            }
        }
        i ++;
    }
    return arr;
}

